import React from "react";
import Footer from "./Footer";
import Captura from "../img/Captura.png";
import { Button } from "react-bootstrap";

class Home extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="d-flex flex-column align-items-center">
          <h3 className="p-3 text-center lh-1">
            Hola mundo, soy Martín Madridejos, <br></br> desarrollador web
            apasionado del mundo Front End
          </h3>
          <img
            src={Captura}
            alt="imagen"
            style={{ width: "200px", borderRadius: "100%" }}
          ></img>
          <h3 className="p-3 text-center lh-1">¡Conóceme más!</h3>
        </div>
        <div className="d-flex flex-column align-items-center m-5">
          <div className="d-flex flex-row">
            <Button className="m-2">Estudios</Button>
            
            <Button className="m-2">Skills</Button>
          </div>
          <div className="d-flex flex-row">
          <Button className="m-2">Proyectos</Button>
          <Button className="m-2"> Experiencia</Button>
          </div>
        </div>

        <Footer />
      </React.Fragment>
    );
  }
}

export default Home;
